import react from "react"
import ItemsContainer from "./ItemsContainer";


function SellPage({ displayedItems, selectUser, handleSearchSubmit }){

  const buttonText= "Edit";

  const userSellItems = displayedItems.filter(item => item.username === selectUser);

  console.log(userSellItems);

  return(
    <div>
      <h1>SellPage</h1>
      <ItemsContainer displayedItems={displayedItems} buttonText={buttonText}/>
    </div>
  )
}

export default SellPage;
